import React from 'react';

function ForecastWeather({ resultData }) {
  return (
    <div className="componentsBoxLayout">
      <p>{resultData.list.splice(0, 7).map((item, index) => (
        <div key={index}>Hello</div>
      ))}</p>
    </div>
  )
}

export default ForecastWeather;
